import React from "react";
import { Link } from "react-router-dom";
import "./contact.css";

const Contact = () => {
  return (
    <div className="contact">
      <div className="container">
        <div className="services"></div>
        <div className="legal"></div>
        <div className="talk-to-us"></div>
      </div>
    </div>
  );
};

export default Contact;
